import axios from 'axios';

const CONFIG_SERVER_API_BASE_URL = "http://localhost:9080/configs";
const CONFIG_SERVER_API_ENVS_URL = "http://localhost:9080/envs";

class ConfigServerService {

    getConfigs(){
        console.log("Reading config data");
        return axios.get(CONFIG_SERVER_API_BASE_URL,"/configs");
    }

    getEnvironments(){
        console.log("Reading Envs data");
        return axios.get(CONFIG_SERVER_API_ENVS_URL,"/envs");
    }

    createConfig(config){
        return axios.post(CONFIG_SERVER_API_BASE_URL, config);
    }

    getConfigById(configId){
        return axios.get(CONFIG_SERVER_API_BASE_URL + '/' + configId);
    }

    updateConfig(config, configId){
        return axios.put(CONFIG_SERVER_API_BASE_URL + '/' + configId, config);
    }

    deleteConfig(configId){
        return axios.delete(CONFIG_SERVER_API_BASE_URL + '/' + configId);
    }
}

export default new ConfigServerService()
